import './App.css';
const logo = '/logo-lightmode.png';

function App() {
  return (
    <div className="App">
         <h1>
          MAPS Spring Challenge
        </h1>
      <header className="App-header">
        <img src={logo} className="Maps-logo" alt="logo" />

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Spring Challenge repo
        </a>
      </header>
    </div>
  );
}

export default App;
